import csv
def find_youngest():
    f = open("oscar_age_actress.csv")
    csv_f = csv.reader(f)
    headers = next(csv_f)
    y_age = 100
    y_name = ""
    for row in csv_f:
        if len(row) > 2:
            age = int(row[2])
            name = row[3].strip('" ')
            if age < y_age:
                y_age = age
                y_name = name
    f.close()
    return (y_name, y_age)

